/**
 * Created by Lenovo on 2019/8/7.
 */
import React from 'react';
export default class Title extends React.Component {
    constructor(props) {
        super(props);
    }
    changeTab(index){
        this.setState({
            activeKey:index
        })
    }
    render() {
        const {title,onLeftClick,onRightClick} =this.props;
        return (
            <div>
               <div>{title}</div>
            </div>
        )
    }
}
